import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { Button, FormControl, FormLabel, Input, Select } from "@chakra-ui/react";
import Footer from "../components/Footer";

const AddStudent = () => {
    const navigate = useNavigate();
    const [student, setStudent] = useState({
        fullname: "",
        profilePicture: "",
        address: "",
        phoneNumber: "",
        birthDate: "",
        gender: "",
        programStudy: "",
    });

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            const response = await fetch("http://localhost:3001/student", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json",
                },
                body: JSON.stringify(student),
            });
            const data = await response.json();
            console.log("Success: ", data);
            navigate("/student");
        } catch (error) {
            console.log("Error: ", error);
        }
    };

    const handleChange = (e) => {
        const { name, value } = e.target;
        let faculty = "";

        if (name === "programStudy") {
            switch (value) {
                case "Ekonomi":
                case "Manajemen":
                case "Akuntansi":
                    faculty = "Fakultas Ekonomi";
                    break;
                case "Administrasi Publik":
                case "Administrasi Bisnis":
                case "Hubungan Internasional":
                    faculty = "Fakultas Ilmu Sosial dan Politik";
                    break;
                case "Teknik Sipil":
                case "Arsitektur":
                    faculty = "Fakultas Teknik";
                    break;
                case "Matematika":
                case "Fisika":
                case "Informatika":
                    faculty = "Fakultas Teknologi Informasi dan Sains";
                    break;
                default:
                    faculty = "";
                    break;
            }
        }

        setStudent({ ...student, [name]: value, faculty });
    };

    return (
        <>
            <form onSubmit={handleSubmit}>
                <div>
                    <FormControl>
                        <FormLabel htmlFor="fullname">Full Name:</FormLabel>
                        <Input
                            type="text"
                            id="fullname"
                            name="fullname"
                            value={student.fullname}
                            onChange={handleChange}
                            data-testid="name"
                            required
                        />
                    </FormControl>
                </div>
                <div>
                    <FormControl>
                        <FormLabel htmlFor="profilePicture">Profile Picture:</FormLabel>
                        <Input
                            type="text"
                            id="profilePicture"
                            name="profilePicture"
                            value={student.profilePicture}
                            onChange={handleChange}
                            data-testid="profilePicture"
                            required
                        />
                    </FormControl>
                </div>
                <div>
                    <FormControl>
                        <FormLabel htmlFor="address">Address:</FormLabel>
                        <Input
                            type="text"
                            id="address"
                            name="address"
                            value={student.address}
                            onChange={handleChange}
                            data-testid="address"
                            required
                        />
                    </FormControl>
                </div>
                <div>
                    <FormControl>
                        <FormLabel htmlFor="phoneNumber">Phone Number:</FormLabel>
                        <Input
                            type="text"
                            id="phoneNumber"
                            name="phoneNumber"
                            value={student.phoneNumber}
                            onChange={handleChange}
                            data-testid="phoneNumber"
                            required
                        />
                    </FormControl>
                </div>
                <div>
                    <FormControl>
                        <FormLabel htmlFor="birthDate">Birth Date:</FormLabel>
                        <Input
                            type="text"
                            id="birthDate"
                            name="birthDate"
                            value={student.birthDate}
                            onChange={handleChange}
                            data-testid="date"
                            required
                        />
                    </FormControl>
                </div>
                <div>
                    <FormControl>
                        <FormLabel htmlFor="gender">Gender:</FormLabel>
                        <Input
                            type="text"
                            id="gender"
                            name="gender"
                            value={student.gender}
                            onChange={handleChange}
                            data-testid="gender"
                            required
                        />
                    </FormControl>
                </div>
                <div>
                    <FormControl>
                        <FormLabel htmlFor="programStudy">Program Study:</FormLabel>
                        <Select
                            id="programStudy"
                            name="programStudy"
                            value={student.programStudy}
                            onChange={handleChange}
                            data-testid="prody"
                            required
                        >
                            <option value="">-- Select Program Study --</option>
                            <option value="Ekonomi">Ekonomi</option>
                            <option value="Manajemen">Manajemen</option>
                            <option value="Akuntansi">Akuntansi</option>
                            <option value="Administrasi Publik">Administrasi Publik</option>
                            <option value="Administrasi Bisnis">Administrasi Bisnis</option>
                            <option value="Hubungan Internasional">Hubungan Internasional</option>
                            <option value="Teknik Sipil">Teknik Sipil</option>
                            <option value="Arsitektur">Arsitektur</option>
                            <option value="Matematika">Matematika</option>
                            <option value="Fisika">Fisika</option>
                            <option value="Informatika">Informatika</option>
                        </Select>
                    </FormControl>
                </div>
                <Button colorScheme="blue" type="submit" data-testid="add-btn">
                    Add Student
                </Button>
            </form>
        </>
    );
};

export default AddStudent;
